        this.state = {location : "a"};
        this.getUpdates = this.getUpdates.bind(this);
    }

    componentDidMount() {
        this.getUpdates();
    }
    getUpdates() {
        var pusher = new Pusher('4b368d79d76620bdd3a5', { 
            authEndpoint: '/pusher_auth',
            cluster: 'eu'
